// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;
pragma experimental ABIEncoderV2;

import '@openzeppelin/contracts-upgradeable/proxy/Initializable.sol';
import '@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol';
import '@openzeppelin/contracts-upgradeable/utils/PausableUpgradeable.sol';
import '@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol';
import '@openzeppelin/contracts/math/SafeMath.sol';
import '@openzeppelin/contracts/utils/Pausable.sol';
import '@openzeppelin/contracts/utils/ReentrancyGuard.sol';
import 'abdk-libraries-solidity/ABDKMath64x64.sol';
import '@openzeppelin/contracts/token/ERC20/IERC20.sol';
// import '@openzeppelin/contracts/token/ERC20/SafeERC20.sol';
import "@openzeppelin/contracts-upgradeable/token/ERC20/SafeERC20Upgradeable.sol";
import './characters.sol';
import './interfaces/IRandoms.sol';
import './interfaces/ICharacter.sol';

contract PreMintSale is
    Initializable,
    AccessControlUpgradeable,
    PausableUpgradeable,
    ReentrancyGuardUpgradeable,
    ICharacter
{
    using SafeMath for uint256;
    using SafeERC20Upgradeable for IERC20;

    bytes32 public constant GAME_ADMIN = keccak256('GAME_ADMIN');

    Characters public characters;
    IRandoms public randoms;
    IERC20 public WETH;

    function initialize(
        Characters _characters,
        IRandoms _randoms,
        address _weth,
        address[] memory _earlyAdopters
    ) public initializer {
        __AccessControl_init();

        _setupRole(DEFAULT_ADMIN_ROLE, msg.sender);
        _setupRole(GAME_ADMIN, msg.sender);
        WETH = IERC20(_weth);
        characters = _characters;
        randoms = _randoms;
        eliteCharacterBaseFee = 20000000000000000;
        traineeCharacterBaseFee = 10000000000000000;
        batchNumber = 1;
        currentTotalMintedElite = 100;
        currentTotalMintedTrainee = 500;
        priceIncreaseEveryBatchForElite = 10000000000000000;
        priceIncreaseEveryBatchForTrainee = 0;
        premintStarts = block.timestamp;
        earlyAdopters = _earlyAdopters;
    }

    uint256 public eliteCharacterBaseFee;
    uint256 public traineeCharacterBaseFee;
    uint256 public batchNumber;
    uint256 public currentTotalMintedElite;
    uint256 public currentTotalMintedTrainee;
    uint256 public priceIncreaseEveryBatchForElite;
    uint256 public priceIncreaseEveryBatchForTrainee;
    mapping(address => uint256) lastBlockNumberCalled;
    address[] public earlyAdopters;
    uint256 public premintStarts;
    uint256 public constant earlyAdoptersDuration = 10800;
    uint256 public constant referralPercent = 25; 
    address public treasury; 

    event updatedBatchNumber(address indexed admin, uint256 batchNumber);

    modifier onlyValidBatch() {
        require(
            batchNumber == currentTotalMintedElite.div(100) &&
                batchNumber <= 9,
            'Batch sales over'
        );
        _;
    }

    modifier onlyValidReferrer(address referrer) {
        if(referrer != address(0)) {
            require(msg.sender != referrer, "Use valid referral" );
            // require(characters.balanceOf(referrer) > 0, "Use valid referral");
        }
        _;
    }

    modifier onlyEarlyAdopters() {
        if((block.timestamp < premintStarts.add(earlyAdoptersDuration))) {
            bool isEarlyAdopter = false;
            for(uint256 i = 0; i < earlyAdopters.length; i++) {
                if(earlyAdopters[i] == msg.sender) {
                    isEarlyAdopter = true;
                }
            }
            require(isEarlyAdopter, "Only Early Adopters access now!");
        }
        _;
    }

    function setTreasury(address _treasury) external onlyOwner {
        treasury = _treasury;
    }

    function setPreMintStartTime() external onlyOwner whenNotPaused {
        premintStarts = block.timestamp;
    }

    function preSaleMintElite(address referral)
        public
        whenNotPaused
        onlyValidBatch
        onlyNonContract
        oncePerBlock(msg.sender)
        nonReentrant
        onlyEarlyAdopters
        onlyValidReferrer(referral)
    {
        require(currentTotalMintedElite <= 1000, "Presale over for Elites");
        require(
            currentTotalMintedElite >= batchNumber.mul(100) &&
                currentTotalMintedElite < batchNumber.add(1).mul(100),
            "Wait for the next batch sale!"
        );
        uint256 mintFee = eliteCharacterBaseFee.add(
            priceIncreaseEveryBatchForElite.mul(batchNumber.sub(1))
        );
        uint256 referralFee = mintFee.mul(referralPercent).div(1000);
        require(
            WETH.allowance(msg.sender, address(this)) >= mintFee,
            "WETH not approved."
        );
        uint256 seed = randoms.getRandomSeed(msg.sender);
        currentTotalMintedElite = currentTotalMintedElite.add(1);

        WETH.transferFrom(msg.sender, address(this), mintFee.sub(referralFee.mul(2)));
        if(referral != address(0)) {
            WETH.transferFrom(msg.sender,referral,referralFee);
        } else {
            WETH.transferFrom(msg.sender,treasury,referralFee);
        }
        WETH.transferFrom(msg.sender,treasury,referralFee);
        characters.mint(msg.sender, seed, CharacterType.Elite, batchNumber.add(1));
    }

    function preSaleMintTrainee(address referral)
        public
        whenNotPaused
        onlyNonContract
        oncePerBlock(msg.sender)
        nonReentrant
        onlyEarlyAdopters
        onlyValidReferrer(referral)
    {
        require(currentTotalMintedTrainee <= 5000, "Presale over for Trainees");
        require(
            WETH.allowance(msg.sender, address(this)) >=
                traineeCharacterBaseFee,
            "WETH not approved."
        );
        uint256 seed = randoms.getRandomSeed(msg.sender);
        uint256 referralFee = traineeCharacterBaseFee.mul(referralPercent).div(1000);
        currentTotalMintedTrainee = currentTotalMintedTrainee.add(1);

        WETH.transferFrom(msg.sender, address(this), traineeCharacterBaseFee.sub(referralFee.mul(2)));
        if(referral != address(0)) {
            WETH.transferFrom(msg.sender,referral,referralFee);
        } else {
            WETH.transferFrom(msg.sender,treasury,referralFee);
        }
        WETH.transferFrom(msg.sender,treasury,referralFee);
        characters.mint(
            msg.sender,
            seed,
            CharacterType.Trainee,
            currentTotalMintedTrainee.mod(5).add(1)
        );
    }

    function startNextBatch() public restricted returns (uint256) {
        // require that admin can not change batchNumber until current sale is over
        require(
            currentTotalMintedElite == batchNumber.add(1).mul(100),
            "Not allowed now."
        );
        batchNumber = batchNumber.add(1);
        emit updatedBatchNumber(msg.sender, batchNumber);
        return batchNumber;
    }

    function addEarlyAdopters(address[] memory users) public restricted {
        require(users.length > 0, "No addresses!");
        for(uint i=0; i< users.length; i++) {
            require(users[i] != address(0), "Address(0) error");
            earlyAdopters.push(users[i]);
        }   
    }

    function getAllEarlyAdopters() public view returns(address[] memory) {
        return earlyAdopters;
    }

    function getMyCharacters() public view returns(uint256[] memory) {
        uint256[] memory tokens = new uint256[](characters.balanceOf(msg.sender));
        for(uint256 i = 0; i < tokens.length; i++) {
            tokens[i] = characters.tokenOfOwnerByIndex(msg.sender, i);
        }
        return tokens;
    }

    function withdraw(uint256 amount) public nonReentrant onlyOwner {
        require(WETH.balanceOf(address(this)) >= amount, "Not enough amount");
        WETH.transfer(msg.sender, amount);
    }

    function pause() external restricted {
        _pause();
    }

    function unpause() external restricted {
        _unpause();
    }

    function _restricted() internal view {
        require(hasRole(GAME_ADMIN, msg.sender), 'NGA');
    }

    function _onlyOwner() internal view {
        require(hasRole(DEFAULT_ADMIN_ROLE, msg.sender), "Admin role needed.");
    }

    function _oncePerBlock(address user) internal {
        require(lastBlockNumberCalled[user] < block.number, 'OCS');
        lastBlockNumberCalled[user] = block.number;
    }

    function _onlyNonContract() internal view {
        require(tx.origin == msg.sender);
    }

    modifier oncePerBlock(address user) {
        _oncePerBlock(user);
        _;
    }

    modifier restricted() {
        _restricted();
        _;
    }

    modifier onlyOwner() {
        _onlyOwner();
        _;
    }

    modifier onlyNonContract() {
        _onlyNonContract();
        _;
    }
}
